<!DOCTYPE html>
<html>
<head>
    <title>X3DOM Test</title>
    <script src="http://ajax.googleapis.com/ajax/libs/jquery/1.11.0/jquery.min.js" type="text/javascript"></script>
    <!-- <script src="/x3dom.1.5.1.js" type="text/javascript"></script> -->
    <script type="text/javascript">
        function getRandomColor() {
            var letters = '0123456789ABCDEF'.split('');
            var color = '#';
            for (var i = 0; i < 6; i++ ) {
                color += letters[Math.round(Math.random() * 15)];
            }
            return color;
        }

        function getURLParameter(name) {
            return decodeURI(
                (RegExp(name + '=' + '(.+?)(&|$)').exec(location.search)||[,null])[1]
            );
        }

        $(document).ready(function  () {

            materials = getURLParameter("materials");
            if (materials == "null") {
                materials = "leave-alone";
            }
            $("input[name='materials'][value='" + materials + "']").prop("checked", true)
            if (materials == "remove-all") {
                $("X3D appearance").find("material").remove();
            } else if (materials == "remove-last") {
                $("X3D appearance").last().find("material").remove();
            }

            if (getURLParameter("remove-materials") == "true") {
                $("X3D appearance").last().find("material").remove();
                $("input[name='remove-materials']").prop("checked", true)
            }

            var version = getURLParameter("version");
            if (version == "null") {
                version = "x3dom-dev.1.6.0";
            }
            console.log("version", version);
            $(".x3dom-version").text(version);
            $("input[name='version'][value='" + version + "']").prop("checked", true);

            var script = document.createElement('script');
            script.type = 'text/javascript';
            script.src = "/" + version + ".js";
            $("x3d").attr("swfpath", "/" + version + ".swf");
            $("head").append(script);


            $("a.add-hair-btn").click(function (evt) {
                evt.preventDefault();
                hair = $("#hair_holder").children().children().clone();

                hair_container = $("<transform class='hair-part'>");
                $("x3d").find("transform").first().append(hair_container);
                $("x3d").find(".hair-part").append(hair);

            });

            $("a.remove-hair-btn").click(function (evt) {
                evt.preventDefault();
                $("x3d .hair-part").empty();
            });


            $("a.change-color-btn").click(function (evt) {
                evt.preventDefault();
                console.log("change-color-btn");

                appearance = $("x3d .head-part, x3d .hair-part").find("Appearance");
                appearance.empty();


                colorHex = getRandomColor();
                colorHex = colorHex.replace("#", "");
                tex = "<PixelTexture DEF=\"PT_test\" image='1 1 3, 0x" + colorHex + "'/><Material diffuseColor='0.6 0.9 0.5'></Material>";
                appearance.append(tex);

            });

            $("a.remove-part-btn").click(function (evt) {
                evt.preventDefault();
                $("x3d .hands-part").children().empty();
            });

            $("a.change-hands-btn").click(function (evt) {
                evt.preventDefault();
                $hands = $("x3d .hands-part");

                hands2 = $hands.children().clone();

                $hands.empty()

                $hands.append(hands2);
            });

            $("a.use-canvas-texture").click(function (evt) {
                evt.preventDefault();
                appearance = $(".head-part").find("appearance");
                appearance
                    .empty()
                    .append("<Texture hideChildren='true'><canvas class='hide-canvas' width='256' height='256'></Texture><Material diffuseColor='0.9 0.6 0.5'></Texture>");

                canvas = appearance.find("canvas")[0];
                ctx = canvas.getContext("2d");

                ctx.fillStyle = getRandomColor();
                ctx.fillRect(0,0, 256, 256);

                ctx.fillStyle = getRandomColor();
                ctx.fillRect(0,0, 128, 256);
            });
        });
    </script>
</head>
<body>

    <form method="get" action="/">
        
        <p>x3dom version (currently: <span class="x3dom-version"></span>)<br>
            <label><input type="radio" name="version" value="x3dom-dev.1.6.0">1.6.0 dev (4/1/14)</label><br>
            <label><input type="radio" name="version" value="x3dom.1.5.1">1.5.1 Stable</label><br>
            <label><input type="radio" name="version" value="x3dom-dev.1.5.0">1.5.0 old dev build</label>
        </p>

        <p>Appearance<br>
            <label><input type="radio" name="materials" value="leave">Leave materials in apearances</label><br>
            <label><input type="radio" name="materials" value="remove-all">Remove all materials (leave textures in appearances)</label><br>
            <label><input type="radio" name="materials" value="remove-last">Remove last material only</label>
        </p>
        <input type="submit" value="Go">
    </form>

    Hair:
    <a class="add-hair-btn" href="#add-hair">Add Hair</a>
    <a class="remove-hair-btn" href="#remove-hair">Remove Hair</a>
    <br>
    Head Apearance: 
    <a class="change-color-btn" href="#change-color">Random Color Pixel Texture</a>&nbsp;&nbsp;
    <a class="use-canvas-texture" href="#canvas-texture">Random Canvas Texture</a>
    <br>
    Hands (apearance links to head's) :  
    <a class="remove-part-btn" href="#remove-part">Remove Hands</a>&nbsp;&nbsp;
    <a class="change-hands-btn" href="#change-hands">Remove and Add Back Hands</a>
    <br>
